DROP DATABASE IF EXISTS medialib;
CREATE DATABASE IF NOT EXISTS medialib;
USE medialib;

DROP TABLE IF EXISTS phone;
CREATE TABLE phone (
  phoneID VARCHAR(7) NOT NULL,
  contributorFID VARCHAR(7) NULL,
  telephone VARCHAR(12) NULL,
  PRIMARY KEY(phoneID)
);

DROP TABLE IF EXISTS email;
CREATE TABLE email (
  emailID VARCHAR(5) NOT NULL,
  contributorFID VARCHAR(7) NULL,
  email VARCHAR(80) NULL,
  PRIMARY KEY(emailID)
); 

DROP TABLE IF EXISTS contributor;
CREATE TABLE contributor (
  contributorID VARCHAR(7) NOT NULL,
  phoneFID VARCHAR(7) NOT NULL,
  emailFID VARCHAR(5) NOT NULL,
  lastName VARCHAR(20) NOT NULL,
  firstName VARCHAR(20) NULL,
  PRIMARY KEY(contributorID),
  FOREIGN KEY(phoneFID) REFERENCES phone(phoneID),
  FOREIGN KEY(emailFID) REFERENCES email(emailID)
); 

ALTER TABLE phone 
 ADD CONSTRAINT FOREIGN KEY (contributorFID) REFERENCES contributor(contributorID);
ALTER TABLE email 
 ADD CONSTRAINT FOREIGN KEY (contributorFID) REFERENCES contributor(contributorID);

DROP TABLE IF EXISTS domestic;
CREATE TABLE domestic (
  contributorID VARCHAR(7) NOT NULL CHECK(contributorID <= 'CB50000'),
  state VARCHAR(2) NULL,
  zipCode INT(5) NULL,
  street VARCHAR(50) NULL,
  city VARCHAR(30) NULL,
  PRIMARY KEY(contributorID),
  FOREIGN KEY(contributorID) REFERENCES contributor(contributorID)
); 


DROP TABLE IF EXISTS nondomestic;
CREATE TABLE nondomestic (
  contributorID VARCHAR(7) NOT NULL CHECK(contributorID >= 'CB50001'),
  country VARCHAR(20) NOT NULL,
  PRIMARY KEY(contributorID),
  FOREIGN KEY(contributorID) REFERENCES contributor(contributorID)
); 

DROP TABLE IF EXISTS role;
CREATE TABLE role (
  roleID VARCHAR(5) NOT NULL,
  roleName VARCHAR(20) DEFAULT NULL,
  PRIMARY KEY(roleID)
); 

DROP TABLE IF EXISTS performance;
CREATE TABLE performance (
  performID VARCHAR(6) NOT NULL,
  titleFID INT(7) NOT NULL,
  contributorFID VARCHAR(7) NOT NULL,
  roleFID VARCHAR(5) NOT NULL,
  PRIMARY KEY(performID),
  FOREIGN KEY(contributorFID) REFERENCES contributor(contributorID),
  FOREIGN KEY(roleFID) REFERENCES role(roleID)
); 

DROP TABLE IF EXISTS type1;
CREATE TABLE type1 (
  typeID VARCHAR(3) NOT NULL,
  audioOrVideo VARCHAR(15) DEFAULT NULL,
  typeName VARCHAR(15) DEFAULT NULL,
  PRIMARY KEY(typeID)
);

DROP TABLE IF EXISTS title;
CREATE TABLE title (
  titleID INT(7) NOT NULL,
  typeFID VARCHAR(3) NOT NULL,
  titleName VARCHAR(50) DEFAULT NULL,
  ageSuitabilityRating VARCHAR(5) NULL,
  PRIMARY KEY(titleID),
  FOREIGN KEY(typeFID) REFERENCES type1(typeID)
); 

ALTER TABLE performance 
 ADD CONSTRAINT FOREIGN KEY (titleFID) REFERENCES title(titleID);

DROP TABLE IF EXISTS media;
CREATE TABLE media (
  mtID VARCHAR(8) NOT NULL,
  titleFID INT(7) NOT NULL,
  typeFID VARCHAR(3) NOT NULL,
  PRIMARY KEY(mtID),
  FOREIGN KEY(typeFID) REFERENCES type1(typeID),
  FOREIGN KEY(titleFID) REFERENCES title(titleID)
);

DROP TABLE IF EXISTS movie;
CREATE TABLE movie (
  mtID VARCHAR(8) NOT NULL CHECK(mtID <= 'mt750000' AND mtID >= 'mt500001'),
  typeFID VARCHAR(3) NOT NULL,
  titleFID INT(7) NOT NULL,
  durationHrs INT(2) DEFAULT '0',
  durationMin INT(2) DEFAULT '0',
  fictionOrNot VARCHAR(10) DEFAULT NULL,
  PRIMARY KEY(mtID),
  FOREIGN KEY(mtID) REFERENCES media(mtID),
  FOREIGN KEY(typeFID) REFERENCES type1(typeID),
  FOREIGN KEY(titleFID) REFERENCES title(titleID)
);
 
 DROP TABLE IF EXISTS music;
CREATE TABLE music (
  mtID VARCHAR(8) NOT NULL CHECK(mtID <= 'mt500000' AND mtID >= 'mt250001'),
  typeFID VARCHAR(3) NOT NULL,
  titleFID INT(7) NOT NULL,
  PRIMARY KEY(mtID),
  FOREIGN KEY(mtID) REFERENCES media(mtID),
  FOREIGN KEY(typeFID) REFERENCES type1(typeID),
  FOREIGN KEY(titleFID) REFERENCES title(titleID)
);
 
DROP TABLE IF EXISTS tv;
CREATE TABLE tv (
  mtID VARCHAR(8) NOT NULL CHECK(mtID >= 'mt750001'),
  titleFID INT(7) NOT NULL,
  typeFID VARCHAR(3) NOT NULL,
  seasonNum INT(2) DEFAULT '1',
  numEpisodes INT(2) DEFAULT '1',
  fictionOrNot VARCHAR(10) DEFAULT 'fiction',
  PRIMARY KEY(mtID),
  FOREIGN KEY(mtID) REFERENCES media(mtID),
  FOREIGN KEY(typeFID) REFERENCES type1(typeID),
  FOREIGN KEY(titleFID) REFERENCES title(titleID)
);
 
DROP TABLE IF EXISTS audiobook;
CREATE TABLE audiobook (
  mtID VARCHAR(8) NOT NULL CHECK(mtID <= 'mt250000'),
  typeFID VARCHAR(3) NOT NULL,
  titleFID INT(7) NOT NULL,
  durationHrs INT(2) DEFAULT '0',
  durationMin INT(2) DEFAULT '0',
  fictionOrNot VARCHAR(10) DEFAULT 'fiction',
  PRIMARY KEY(mtID),
  FOREIGN KEY(mtID) REFERENCES media(mtID),
  FOREIGN KEY(typeFID) REFERENCES type1(typeID),
  FOREIGN KEY(titleFID) REFERENCES title(titleID)
);
 
DROP TABLE IF EXISTS publisher;
CREATE TABLE publisher (
  publisherID VARCHAR(4) NOT NULL,
  publisherName VARCHAR(30) NOT NULL,
  PRIMARY KEY(publisherID)
);
 
DROP TABLE IF EXISTS publisher_title;
CREATE TABLE publisher_title (
  ptID VARCHAR(7) NOT NULL,
  publisherFID VARCHAR(4) NOT NULL,
  titleFID INT(7) NOT NULL,
  publishYear INT(4) DEFAULT NULL,
  PRIMARY KEY(ptID),
  FOREIGN KEY(publisherFID) REFERENCES publisher(publisherID),
  FOREIGN KEY(titleFID) REFERENCES title(titleID)
);

DROP TABLE IF EXISTS category;
CREATE TABLE category (
  categoryID VARCHAR(5) NOT NULL,
  digitalOrPhysical VARCHAR(10) DEFAULT NULL,
  PRIMARY KEY(categoryID)
);

DROP TABLE IF EXISTS catformat;
CREATE TABLE catformat (
  ctID VARCHAR(8) NOT NULL,
  titleFID INT(7) NOT NULL,
  categoryFID VARCHAR(5) NOT NULL,
  PRIMARY KEY(ctID),
  FOREIGN KEY(titleFID) REFERENCES title(titleID),
  FOREIGN KEY(categoryFID) REFERENCES category(categoryID)
);
 
DROP TABLE IF EXISTS physical;
CREATE TABLE physical (
  ctID VARCHAR(8) NOT NULL CHECK(ctID >= ct500001),
  titleFID INT(7) NOT NULL,
  categoryFID VARCHAR(5) NOT NULL,
  physicalFormat VARCHAR(15) NULL,
  numMediaObjects INT(2) NULL,
  PRIMARY KEY(ctID),
  FOREIGN KEY(ctID) REFERENCES catformat(ctID),
  FOREIGN KEY(titleFID) REFERENCES title(titleID),
  FOREIGN KEY(categoryFID) REFERENCES category(categoryID)
);
 
DROP TABLE IF EXISTS digital;
CREATE TABLE digital (
  ctID VARCHAR(8) NOT NULL CHECK(ctID <= ct500000),
  titleFID INT(7) NOT NULL,
  categoryFID VARCHAR(5) NOT NULL,
  website VARCHAR(80) NULL,
  PRIMARY KEY(ctID),
  FOREIGN KEY(ctID) REFERENCES catformat(ctID),
  FOREIGN KEY(titleFID) REFERENCES title(titleID),
  FOREIGN KEY(categoryFID) REFERENCES category(categoryID)
);

DROP TABLE IF EXISTS genre;
CREATE TABLE genre (
  genreID VARCHAR(7) NOT NULL,
  genreName VARCHAR(30) NOT NULL,
  PRIMARY KEY(genreID)
);

DROP TABLE IF EXISTS genre_title;
CREATE TABLE genre_title (
  gtID VARCHAR(8) NOT NULL,
  titleFID INT(7) NOT NULL,
  genreFID VARCHAR(7) NOT NULL,
  PRIMARY KEY(gtID),
  FOREIGN KEY(titleFID) REFERENCES title(titleID),
  FOREIGN KEY(genreFID) REFERENCES genre(genreID)
);

