ALTER TABLE contributor ADD nationality VARCHAR(15) DEFAULT NULL;
UPDATE contributor SET nationality = 'nondomestic' WHERE contributor.contributorID >= 'CB50001';
UPDATE contributor SET nationality = 'domestic' WHERE contributor.contributorID < 'CB50001';

ALTER TABLE media ADD mediaName VARCHAR(20) DEFAULT NULL;
UPDATE media SET mediaName = 'audiobook' WHERE media.mtID <= 'mt250000';
UPDATE media SET mediaName = 'music' WHERE media.mtID <= 'mt500000' AND mtID >= 'mt250001';
UPDATE media SET mediaName = 'movies' WHERE media.mtID <= 'mt750000' AND mtID >= 'mt500001';
UPDATE media SET mediaName = 'tv' WHERE media.mtID >= 'mt750001';

ALTER TABLE digital ADD digitalFormat VARCHAR(20) DEFAULT NULL;
UPDATE digital SET digitalFormat = 'Streaming' WHERE digital.ctID >= 'ct500001';


DELIMITER //
CREATE PROCEDURE getTitles()
BEGIN
	SELECT *  FROM title
		ORDER BY title.titleID
			LIMIT 10;
            
END //
DELIMITER ;
CALL getTitles();

DROP TABLE IF EXISTS altered_contributors;
CREATE TABLE altered_contributors (
  contributorID VARCHAR(7) NOT NULL,
  phoneFID VARCHAR(7) NULL,
  emailFID VARCHAR(5) NULL,
  lastName VARCHAR(20) NOT NULL,
  firstName VARCHAR(20) NOT NULL,
  PRIMARY KEY(contributorID),
  FOREIGN KEY(phoneFID) REFERENCES phone(phoneID),
  FOREIGN KEY(emailFID) REFERENCES email(emailID)
);

DROP TRIGGER IF EXISTS before_delete_contributor;
DELIMITER //
CREATE TRIGGER before_delete_contributor
 BEFORE DELETE
 ON contributor FOR EACH ROW
BEGIN
 INSERT INTO altered_contributors (contributorID,phoneFID,emailFID,lastName,firstName) values (old.contributorID, old.phoneFID, old.emailFID,old.lastName,old.firstName);
END//
DELIMITER ;

SHOW TRIGGERS;
SELECT * FROM altered_contributors;


SELECT *
	FROM contributor
		ORDER BY contributorID
			LIMIT 5;

DELETE FROM medialib.contributor WHERE contributor.contributorID = 'CB00001' AND contributor.lastName = 'Fitzgerald';

SELECT *
	FROM contributor
		ORDER BY contributorID
			LIMIT 5;
            
SET SQL_SAFE_UPDATES = 0;

UPDATE contributor
	SET lastName = 'Wylie'
		WHERE contributor.contributorID = 'CB00002';

SELECT *
	FROM contributor
		WHERE lastName = 'Wylie';

-- Function that counts number of audiobooks in database
DELIMITER //
CREATE
   DEFINER = CURRENT_USER
   FUNCTION audiobook_count()
   RETURNS INT DETERMINISTIC
   BEGIN
	  DECLARE temp INT;
	  SET temp = 0;
      SELECT COUNT(*) INTO temp FROM audiobook;
      RETURN temp;
   END //
   DELIMITER ;

SHOW FUNCTION STATUS WHERE db = 'medialib';
SELECT audiobook_count();

DROP VIEW IF EXISTS newView;
CREATE VIEW newView
	AS SELECT
		domestic.state, domestic.zipCode, domestic.street, domestic.city, nondomestic.country, contributor.lastName, contributor.firstName, contributor.phoneFID, contributor.emailFID
		FROM contributor
			LEFT JOIN domestic ON domestic.contributorID = contributor.contributorID
            LEFT JOIN nondomestic ON nondomestic.contributorID = domestic.contributorID;
            
