-- Title Report (b) List titlename, categoryName, mediaName for all movies available in DVD or BluRay format.
DROP TABLE IF EXISTS newTable;
CREATE TABLE newTable
	AS SELECT
		title.titleName, media.mediaName, title.titleID
		FROM title
			LEFT JOIN media ON media.titleFID = title.titleID;

DROP TABLE IF EXISTS newTable1;
CREATE TABLE newTable1
	AS SELECT
		newTable.titleName, newTable.mediaName, newTable.titleID, physical.physicalFormat, physical.categoryFID
		FROM newTable
			LEFT JOIN physical ON physical.titleFID = newTable.titleID;

DROP TABLE IF EXISTS newTable2;
CREATE TABLE newTable2
	AS SELECT
		newTable1.titleName, newTable1.mediaName, newTable1.titleID, newTable1.physicalFormat, newTable1.categoryFID, category.digitalOrPhysical 
		FROM newTable1
			LEFT JOIN category ON category.categoryID = newTable1.categoryFID;
            
SELECT newTable2.titleID, newTable2.titleName AS 'Title', newTable2.digitalOrPhysical AS 'Category Name', newTable2.mediaName AS 'Media', newTable2.physicalFormat AS'FORMAT'
		FROM newTable2
			WHERE newTable2.physicalFormat =  'CD' OR newTable2.physicalFormat = 'BluRay';

