-- Contributor reports b.List all the British artists who have contributed, the titles to which they have contributed, and the roles for those titles.
-- We don't have a Rock genre, so we used Jazz
SELECT
	DISTINCT newTable14.titleName, newTable14.genreName, newTable14.mediaName, COUNT(DISTINCT(newTable14.physicalFormat)) AS 'Physical Format',  COUNT(newTable14.digitalFormat) AS 'Streaming'
    FROM newTable14
		WHERE (newTable14.physicalFormat = 'DVD' OR newTable14.physicalFormat = 'BluRay' OR newTable14.digitalFormat = 'Streaming') AND newTable14.mediaName = 'movies' AND newTable14.genreName = ' Drama';
        
SELECT 
	newTable14.lastName, newTable14.firstName, newTable14.titleName, newTable14.roleName
	FROM newTable14, nondomestic
		WHERE newTable14.contributorID = nondomestic.contributorID AND nondomestic.country='England';

